import React from 'react';
import './ListItem.css';

const ListItems=({items})=>{
    const itemList = items.map((el) => {
        return  <span key={el.id}>{el.name}</span>
    })
    return(
        <div className="ListItems">
            {itemList}
        </div>
    )
};
export default ListItems;
